  const [data,setData] = useState([]);
  useEffect(()=>{
    loadData();
  },[])

  const loadData = async ()=>{
    const res = await Axios.get("http://localhost:5000/employees");
    console.log(res.data)
  }
  return (
    <div className="information">
      <form >
        <div className='labelRow'>
        <label> Name </label>
        </div>
        <input type="text" name="name" onChange={(e) =>e.target.value}></input>
        <div className ='labelRow'>
        <label> age </label>
        </div>
        <input type="text" name="age" onChange={(e) =>e.target.value}></input>
        <div className ='labelRow'>
        <label> email </label>
        </div>
        <input type="text" name="email" onChange={(e) =>e.target.value}></input>
        <div className='labelRow'>
        <label> salary </label>
        </div>
        <input type="text" name="salary" onChange={(e) =>e.target.value}></input>
        <div className='labelRow'>
        <label> position </label>
        </div>
        <input type="text" name="position" onChange={(e) =>e.target.value}></input>

      </form>
    </div>
  );

}

export default App;
